import React from 'react'
import ReactDOM from "react-dom/client"
import "./style.css"
import one from "./Assets/images/one.jpg"
import two from "./Assets/images/two.jpg"

const root = ReactDOM.createRoot(document.getElementById("root"))

//Navbar Component

function Navbar()
{
  return(
    <nav>
      <h1>Perfumy</h1>
      <ul>
        <li>Home |</li>
        <li>product |</li>
        <li>About |</li>
        <li>Contact</li>
      </ul>
    </nav>

  )
}

//Search Component
function Search()
{
  return(
    <div className="searchbar">
       <input type="text" placeholder="Search Perfume"/>
    </div>
  )
}

//Product Component
function Product()
{
  return(
    <div class="products">

            <div class="box">

                        <img src={one}></img>
                        <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p>    
            </div>


            <div class="box">
                <img src="./images/three.jpg" alt="villain"></img>
                <p>Fogg Wood Extreme, Eau De Parfum, Long-lasting Perfume, 100ml</p> 
            </div>
            <div class="box">
                <img src="./images/two.jpg" alt="Designs Club"></img>
                <p>Designer Club-Be Spoke by Perfume Lounge Men's Perfume | Premium Long Lasting Perfume</p>
            </div>


        </div>
  )
}


root.render(
  <div>
    <Navbar></Navbar>
    <Search></Search>
    <Product></Product>
  </div>
)
